  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of digital still
  transect images (JPG files) from CRAMP surveys taken on Maui in 2006 at 8 sites,
  some of which had multiple depths. Surveys typically consist of shallow (~3m) and
  deep (~10m) lines. Digital images are important for future researchers to resolve
  any question about how the image data were interpreted for the quantitative database,
  to provide the opportunity to re-analyze the images using other methods, and to
  return to the same locations for future comparisons. In a separate NODC Accession,
  text data files are given of the substrate types and coverages as derived objectively
  from photographic images using PhotoGrid, a software package which analyzes random
  points on images of coral reefs and substrate.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
